import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for sidebar suggestions to load
    await page.waitForSelector('.suggestion-item');

    // Extract usernames and follower counts from suggestion items
    const extractedData = [];
    const suggestionItems = await page.$$('.suggestion-item');

    for (const item of suggestionItems) {
      const usernameElement = await item.$('.suggestion-username');
      const statsElement = await item.$('.sidebar .stats strong');

      const username = usernameElement ? await usernameElement.evaluate(el => el.textContent) : null;
      const followerCount = statsElement ? await statsElement.evaluate(el => el.textContent) : null;

      if (username && followerCount) {
        extractedData.push({ username, followerCount });
      }
    }

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_extraction.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_extraction.png'));

    return {
      success: true,
      action: "Extracted usernames and follower counts from sidebar suggestions",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
